webpackJsonp([0xe98d3a1a14f1],{3507:function(a,t){a.exports={data:{markdownRemark:{html:'<p>“<a href="/kuto">YASiM-CITY solo/空想都市計画</a>”では余りに広い範囲に手を出し過ぎかえって失敗したので、サイトの規模を大きく縮小し、名を“Vanished YASiM-CITY”と変更。 自作コンテンツ(主に楽曲、たまにゲームとかイラストとか)の配布のみに絞ってみる。ごく最近までこのサイトが原型となっていた。  <img src="https://danmaq.com/wp-content/uploads/1999/09/vy.png"> ケータイ(au)対応コンテンツなども作って、かなりの人数を呼び込めた。40～80PV/day。これ以降は現在に至るまでほぼ安定して毎日2～3桁のアクセス数があるようだ。背景色純白(後期は薄緑)。 表で細々更新しながらも陰であやしいことばっかやってた時代。今使ってるハンドル“<a href="/danmaq">まく</a>”もこのとき考えたモノ。まぁ、もう時効でしょ。</p>',frontmatter:{cover:null,date:"2001-03-06T00:00:00+09:00",strDate:"2001/3/5",title:"Vanished YASiM-CITY"}}},pathContext:{path:"/ja/blog/2001/03/06-vanished-yasim-city/",langKey:"ja"}}}});
